<template>
	<view class="content">
		<view class="login_box">
			<form @submit="formSubmit" @reset="formReset">
				<view class="title">登录</view>
				<label class="login_input">
					<view class="text">用户名：</view>
					<input type="text" name="mobile" placeholder="请输入手机号码或账号" />
				</label>
				<label class="login_input">
					<view class="text">密码：</view>
					<input type="text" name="password" password placeholder="请输入密码" />
				</label>
				<button class="login_button" form-type="submit">立即登陆</button>
				<view class="login_xieyi">
				 
					 <switch :checked="checked_y" @change="agree" value="cc" type="checkbox" style="transform:scale(0.7);    margin-left: -20px;" color="#3c5dd6" />
					 
					 <view @click="change_rule">请阅读账户服务协议</view>
				</view>
			</form>
		</view>
		<view class="login_tanchuang" v-if="login_tanchuang">
			<view class="login_tc_title">用户协议</view>
			<view class="login_tc_box">
				 <rich-text :nodes="content"></rich-text>
			</view>
			<view class="login_tc_close" @click="change_rule_close">我已阅读并同意</view>
		</view>
	</view>
</template>

<script>
	import base from '@/common/base.js';
	export default {
		data() {
			return {
				login_tanchuang: false,
				checked_y:false,
				accept: 0, //是否同意协议
				content: ""
			}

		},
		onLoad() {
			var _this = this;
			_this.get_login_pact();

		},

		onShareAppMessage(res) {
			return {}
		},

		methods: {
           get_login_pact() {
				var _this = this;
				var globalData = getApp().globalData;
				var web_site = globalData.web_site;
				var key = globalData.key;;
				var secret = globalData.secret;;
				var time = base.get_time();
				var rand_num = base.get_rand_num(8);
				var sign = base.get_app_key(secret, key, rand_num, time);
				wx.request({
					url: web_site + '/api/baselogin/get_user_treaty',
					method: 'POST',
					header: {
						'Content-Type': 'application/x-www-form-urlencoded'
					},
					data: {
						rand_num: rand_num,
						time: time,
						sign: sign,
						key: key,
						secret: secret
					},
					success: res => {
						var result = res.data;
						if (result.code == '0') {
							_this.content = result.data.content;
						}
					}
				})

			},
       
            
			agree: function(e) {
				var that = this;
				if (e.detail.value == true) {
				   that.accept = 1
				 } else if (e.detail.value == false) {
					that.accept = 0
				}
			},
			 change_rule() {
				this.login_tanchuang = true;
				this.accept = 1;
				this.checked_y = true;
			},
			change_rule_close(){
				this.login_tanchuang = false;
			},
			openid(loginRes) {
				var globalData = getApp().globalData;
				var web_site = globalData.web_site;
				var key = globalData.key;;
				var secret = globalData.secret;;
				var time = base.get_time();
				var rand_num = base.get_rand_num(8);
				var sign = base.get_app_key(secret, key, rand_num, time);
				var uid = uni.getStorageSync('member_id');
				uni.request({
					url: web_site + '/api/index/get_wx_openid',
					method: 'POST',
					header: {
						'content-type': 'application/x-www-form-urlencoded'
					},
					data: {
						rand_num: rand_num,
						time: time,
						sign: sign,
						key: key,
						secret: secret,
						wx_code: loginRes,
						uid: uid,
					},
					success: res => {
						var result = res.data; 
						if (result.code == '0') {
							uni.showToast({
								title: result.msg,
								icon: 'none'
							});
						    this.changeLogin()
							return true;
						} else {
							uni.showToast({
								title: result.msg,
								icon: 'none'
							});
							return false;
						}
					}
				});
			},
			
			changeLogin(){
				uni.getUserInfo({
					provider: 'weixin',
					success(res) {
						uni.reLaunch({
						  url: '/pages/index/index'
						})
					},
					fail() {
					   uni.navigateTo({
						  url: '/pages/shouquan/shouquan'
					 })
					}
				});
			  },

			formSubmit: function(e) {
                var _this = this;
				var data = e.detail.value; 
				var mobile = data.mobile == undefined || data.mobile == '' ? '' : data.mobile;
				var password = data.password == undefined || data.password == '' ? '' : data.password;
				var globalData = getApp().globalData;
				var web_site = globalData.web_site;
			    var time = base.get_time();
				var accept = this.accept;
				var rand_num = base.get_rand_num(8);
				var sign = base.get_app_key(rand_num, time);
				if (mobile == '') {
					uni.showToast({
						title: '请输入手机号',
						icon: 'none'
					});
					return false;
				}
				if (password == '') {
					uni.showToast({
						title: '请输入密码',
						icon: 'none'
					});
					return false;
				}
				if (this.accept != 1) {
					uni.showToast({
						title: '请勾选协议',
						icon: 'none'
					});
					return false;
				}
                uni.request({
					url: web_site + '/api/baselogin/login',
					method: 'POST',
					header: {
						'content-type': 'application/x-www-form-urlencoded'
					},
					data: { 
						mobile: mobile,
						password: password,
						accept:accept
					}, 
					success: res => {
						var result = res.data; 
						 console.log(result)
						if (result.code == '0') {
							var member_id = result.data.uid;
							var secret = result.data.secret;
							var key = result.data.key; 
							console.log(member_id)
							console.log(secret)
							console.log(key) 
							uni.setStorageSync('member_id', member_id);
							uni.setStorageSync('secret', secret);
							uni.setStorageSync('key', key);
							uni.login({
								provider: 'weixin',
								success: function(loginRes) { 
									_this.openid(loginRes.code)
								},
							});
						} else {
							uni.showToast({
								title: result.msg,
								icon: 'none'
							});
							return false;
						}
					}
				});
			},
		}
	}
</script>

